"use strict";

var pug = require('../../');

test('layout with duplicate block', function () {
  var outputWithAjax = pug.renderFile(__dirname + '/index.pug', {
    ajax: true
  });
  var outputWithoutAjax = pug.renderFile(__dirname + '/index.pug', {
    ajax: false
  });
  expect(outputWithAjax).toMatchSnapshot();
  expect(outputWithoutAjax).toMatchSnapshot();
});